import React, {Component, Fragment} from "react";
import Layout from './Layout';

class Page extends Component {



    componentDidMount() {
        console.log(this.props)
    }

    render() {
        return (
            <Fragment>
                <Layout>
                    {this.props.children}
                </Layout>
            </Fragment>
        );
    }
}


export default Page;
